                <div className="tabs">
                  <span className="tabs-count">{item.score}</span>
                  <br />
                  votes
                </div>
              </Col>
              <Col sm={1}>
                <div className="tabs">
                  <span className="tabs-count">{item.answer_count}</span>
                  <br />
                  answers
                </div>
              </Col>
              <Col sm={1}>
                <div className="tabs">
                  <span className="tabs-count">{item.view_count}</span>
                  <br />
                  views
                </div>
              </Col>
              <Col sm={9}>
                <a href={item.link} className="title">
                  {item.title}
                </a>
                <br />
                <p>
                  {item.tags.map((tag, i) => {
                    return (
                      <span key={i} className="tag">
                        {tag}
                      </span>
                    );
                  })}
                </p>
              </Col>
            </Row>
          );
        })}
      </Container> */}
      <div className="container">
        {props.questions.map((question) => {
          return (
            <div key={question.question_id} className="row">
              <div className="col-md-2">
                <div className="tabs mb-4">
                  <span className="tabs-count">{question.score}</span>
                  <br />
                  <span>votes</span>
                  <br />
                  <span className="tabs-count">{question.answer_count}</span>
                  <br />
                  <span>answers</span>
                  <br />
                  <span>{question.view_count}</span> <span>views</span>
                </div>
              </div>
              <div className="col-md-10">
                <a href={question.link} className="title">
                  {question.title}
                </a>
                <p>
                  {item.tags.map((tag, i) => {
                    return (
                      <span key={i} className="tag">
                        {tag}
                      </span>
                    );
                  })}
                </p>
              </div>
              <hr />
            </div>
          );
        })}
      </div>
      <br />
    </div>
  );
};

export default TopQuestions;
